import styled, { keyframes } from "styled-components";

export const OutModal = styled.div`
    z-index: 10;
    display: block;
    background: rgba(0,0,0,0.3);
    position: fixed;
    width: 100vw;
    height: 100vh;
`

export const Vibration= keyframes`
    from {
      transform: rotate(1deg);
    }
    to {
      transform: rotate(-1deg);
    }
`
